const EditDetails = () => {
  return (
    <div className="bg-gray-500 bg-opacity-50 top-0 left-0 flex items-center justify-center  modal-window  fixed z-50 ">
      <div className="dialog p-8 rounded-md  bg-white">
        <p className="text-3xl font-medium tracking-tight">
          Edit Personal Details
        </p>
        <p className="text-3xl sub-txt font-medium tracking-tight">Gender:</p>
      </div>
    </div>
  );
};
export default EditDetails;
